import React from 'react';
import LiveCard from "./LiveCard";
import Home from '../Home'

const CitySearch = (props) => {





	return (

		<div>
			<form>
                <label>City:
                <input type="text" id="city" name="city" onChange={props.handleChange} placeholder="Enter a City" />
                </label>
                <input type="submit" onClick={props.searchHandle} value="Go" />
            </form>
			<LiveCard weather={props.weather} />
		</div>
	);
}


export default CitySearch;
